[{'comment_id': 450269049, 'comment_body': "This does not seem right to me. Anyway in general I don't think this code should be calling readBytes / writeBytes; rather the channel should be configured for binary I/O (and specify the appropriate endianness) and then this code should just do read and write. ", 'comment_created': datetime.datetime(2020, 7, 6, 14, 40, 43, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 450293394, 'comment_body': 'I guess you are pointing towards something like this ->
```
var f = open("out", iomode.cw, style = new iostyle(binary=1));
```
If our current implementation is seen, the channel passed to the serialize/unserialize procs is controlled by the user. Is there any other way we can achieve the binary configuration?', 'comment_created': datetime.datetime(2020, 7, 6, 15, 15, 50, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 450330396, 'comment_body': "Yes, there are two ways.

First, one can call 'set_style' - see https://github.com/chapel-lang/chapel/blob/c54a5da1fec9f5d889a805c54485d728db6dc467/modules/standard/IO.chpl#L2443 and https://github.com/chapel-lang/chapel/blob/c54a5da1fec9f5d889a805c54485d728db6dc467/modules/standard/IO.chpl#L2459 . You will want to lock the channel before doing these (and unlock it after) - see https://github.com/chapel-lang/chapel/blob/c54a5da1fec9f5d889a805c54485d728db6dc467/modules/standard/IO.chpl#L2193 . I think it would make sense to lock the channel for the entire serialization / deserialization operation.

Second, it's possible to create a new channel based upon another existing channel. For example see https://github.com/chapel-lang/chapel/blob/c54a5da1fec9f5d889a805c54485d728db6dc467/modules/standard/IO.chpl#L3162-L3169 . This is relevant because the Chapel channel types incudes a `param` (known at compile time) indicating binary I/O and endianness (see code starting at https://github.com/chapel-lang/chapel/blob/c54a5da1fec9f5d889a805c54485d728db6dc467/modules/standard/IO.chpl#L461 ) . So, it is possible to wrap the existing channel in a binary-big-endian channel, for example. This can be faster and allows us to skip even code handling locking. However there isn't a good user-facing way to do it yet (although I think such a thing would be reasonable to add to the I/O system; if we choose this path, the protobuf code will use some internal details of channel - or we have to add the user-facing thing to IO.chpl soon).", 'comment_created': datetime.datetime(2020, 7, 6, 16, 12, 51, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 450332842, 'comment_body': 'Oh, another interesting thing about the second option, is that it would allow all of your functions working with channels to have a concrete type.', 'comment_created': datetime.datetime(2020, 7, 6, 16, 16, 39, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 450333309, 'comment_body': "A third option is to use `writef`/`readf`. In practice this will just modify the channel's style to indicate binary I/O for each operation. (You could do that also - modify the style per-operation).", 'comment_created': datetime.datetime(2020, 7, 6, 16, 17, 27, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451001122, 'comment_body': '@mppf I think now we can make the `ch` argument concrete? Something like this ->

`proc unsignedVarintConsume(ch: channel(false,iokind.little,false)): (uint, int) throws {`', 'comment_created': datetime.datetime(2020, 7, 7, 16, 42, 29, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451069753, 'comment_body': 'Yes', 'comment_created': datetime.datetime(2020, 7, 7, 18, 43, 9, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451072170, 'comment_body': 'Yup did that :+1: ', 'comment_created': datetime.datetime(2020, 7, 7, 18, 47, 44, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451461283, 'comment_body': "It is not a big deal but I think this is better written
```
var zero: uint(8);
ch.write(zero);
```

I understand that is longer (it's just that it keeps the code using simpler I/O).", 'comment_created': datetime.datetime(2020, 7, 8, 11, 7, 10, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451462413, 'comment_body': 'It might be nice to use type aliases for this channel type, at the top of the file, like
```
type writingChannel = channel(true,iokind.little,false);
type readingChannel = channel(false,iokind.little,false);
```
this will reduce future maintenance work if these types change for some reason.', 'comment_created': datetime.datetime(2020, 7, 8, 11, 9, 40, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451463147, 'comment_body': 'This will throw if the string is not UTF-8. Is that expected behavior for protocol buffer messages? (If this is a complex question to answer, feel free to add a TODO to check in your task list).', 'comment_created': datetime.datetime(2020, 7, 8, 11, 11, 12, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451463795, 'comment_body': 'This can just be `ch.write(newByte)` but more generally this is just outputting the 32-bit value in big-endian format. Which makes me wonder if iokind.big would be a better setting for the channels? If iokind.big is the setting, then this would just be `ch.write(val)`.

This comment applies similarly to all of the fixed append and consume functions.', 'comment_created': datetime.datetime(2020, 7, 8, 11, 12, 33, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451466572, 'comment_body': "I was expecting that this code would be in the user-facing Chapel module supporting protobuf. Anyway it would be better if we can find a way to avoid putting it in the protobuf compiler plugin because that makes it harder to update and it's relatively strange code.

Put another way, in an expected use case, where is writeToOutputFile called? Is it possible to handle the locking and making the binary channel at that point?

If not, is it possible to put these details in a helper function?", 'comment_created': datetime.datetime(2020, 7, 8, 11, 18, 20, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451600818, 'comment_body': '> Put another way, in an expected use case, where is writeToOutputFile called

`writeToOutputFile` is present in the chapel code generated through the plugin. It is called by the user in a `write.chpl` file (for e.g) to get the serialized values written to an `out` file. Example ->

```
use repeatedfield;
use IO;

var file = open("out", iomode.cw);
var writingChannel = file.writer();

var messageObj = new repeatedField();

messageObj.ui64.append(1);
messageObj.ui64.append(2445464);

messageObj.writeToOutputFile(writingChannel);
```

> I was expecting that this code would be in the user-facing Chapel module supporting protobuf.

I don't see a way of doing this with concrete functions, the `ch` channel from  `writeToOutputFile ` is passed directly to Append functions present in the user-facing Chapel module.

I also see that https://github.com/chapel-lang/chapel/pull/16032 is merged, can't we directly use the user exposed IO function for creating the new channel?', 'comment_created': datetime.datetime(2020, 7, 8, 14, 44, 20, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451607193, 'comment_body': '> This comment applies similarly to all of the fixed append and consume functions.

I am also a bit confused regarding the encoding/decoding of fixed types. The protobuf-encoding guide states them to be encoded as little-endian, but I saw a similar kind of implementation in Go protbuf library by Google(https://github.com/protocolbuffers/protobuf-go/blob/master/encoding/protowire/wire.go#L373). ', 'comment_created': datetime.datetime(2020, 7, 8, 14, 52, 49, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451620661, 'comment_body': 'From the protobuf encoding guide for [Strings](https://developers.google.com/protocol-buffers/docs/encoding#strings)

> The red bytes are the UTF8 of "testing". The key here is 0x12 â†’

I understand that string type expects users to pass a UTF-8 value, other values can be handles through bytes type. Though I am not 100% sure on this. ', 'comment_created': datetime.datetime(2020, 7, 8, 15, 11, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451620921, 'comment_body': 'Yes! Agreed, will do that.', 'comment_created': datetime.datetime(2020, 7, 8, 15, 11, 22, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451621284, 'comment_body': 'Yeah, I will make the change :)', 'comment_created': datetime.datetime(2020, 7, 8, 15, 11, 48, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451635691, 'comment_body': '> This can just be `ch.write(newByte)`

Ohh! I missed that, will change it :+1: ', 'comment_created': datetime.datetime(2020, 7, 8, 15, 31, 53, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 451715686, 'comment_body': "> I also see that chapel-lang/chapel#16032 is merged, can't we directly use the user exposed IO function for creating the new channel?

Yes

> I don't see a way of doing this with concrete functions, the ch channel from writeToOutputFile is passed directly to Append functions present in the user-facing Chapel module.

Does that mean you do see a way of doing it with generic functions?

(e.g. message.writeToOutputFile calls Encoding.helpWriteToOutputFile(message, channel) which calls message.doWriteToOutputFile(channel) ?)", 'comment_created': datetime.datetime(2020, 7, 8, 17, 37, 43, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451716553, 'comment_body': '> I am also a bit confused regarding the encoding/decoding of fixed types. The protobuf-encoding guide states them to be encoded as little-endian, but I saw a similar kind of implementation in Go protbuf library by Google(https://github.com/protocolbuffers/protobuf-go/blob/master/encoding/protowire/wire.go#L373).

That go implementation is writing it little endian. So is your loop here, I think I read it wrong before. Anyway you should be able to just write `ch.write(val)`. Give it a try?', 'comment_created': datetime.datetime(2020, 7, 8, 17, 39, 15, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 451718151, 'comment_body': 'I think protocol buffer strings are always UTF-8 - see https://developers.google.com/protocol-buffers/docs/proto3#scalar 

> \xa0 A string must always contain UTF-8 encoded or 7-bit ASCII text, and cannot be longer than 2^32.



', 'comment_created': datetime.datetime(2020, 7, 8, 17, 41, 51, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452109464, 'comment_body': 'Yes! Agreed.', 'comment_created': datetime.datetime(2020, 7, 9, 10, 7, 24, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452115162, 'comment_body': 'Yes, it works!', 'comment_created': datetime.datetime(2020, 7, 9, 10, 18, 16, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452136606, 'comment_body': '@mppf I made the changes in 382a749 and updated the output file in the pr message. Please review.', 'comment_created': datetime.datetime(2020, 7, 9, 11, 1, 19, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452216715, 'comment_body': 'The example output looks good. It will be relatively easy to add similar methods for reading from / writing to bytes using this mechanism!', 'comment_created': datetime.datetime(2020, 7, 9, 13, 28, 3, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452218120, 'comment_body': 'this and many other `var wireType` or `const wireTiype` are unused variables.

That might mean you can remove the `wireTypes` consts at the top, too.', 'comment_created': datetime.datetime(2020, 7, 9, 13, 30, 9, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452219793, 'comment_body': "It's not something you have to change for this PR, but I wonder if `appendUnsignedVarint` would be a nicer method name. Not a big deal either way right now. (But, while these functions are not really intended to be user-facing, they do tie the protocol buffer compiler to particular versions of this module, so they should be stable). I recommend we revisit these names when we do the API review.", 'comment_created': datetime.datetime(2020, 7, 9, 13, 32, 26, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452222100, 'comment_body': 'This should still lock and unlock the channel, right?

