```', 'comment_created': datetime.datetime(2020, 7, 9, 13, 35, 56, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452222229, 'comment_body': 'needs to lock/unlock as well', 'comment_created': datetime.datetime(2020, 7, 9, 13, 36, 7, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452223178, 'comment_body': "Shouldn't this function be marked `throws` ? As well as the read version and the code calling it generated by the protobuf compiler?", 'comment_created': datetime.datetime(2020, 7, 9, 13, 37, 26, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452223341, 'comment_body': 'Yes! The output is generated from the plugin itself. I think now we are good to go with this pr?', 'comment_created': datetime.datetime(2020, 7, 9, 13, 37, 41, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452223960, 'comment_body': "I'm not confident than Encoding will remain the name of this module but I recommend that we leave that choice for the API review. (In particular I think it probably should mention protobuf somewhere in the name).", 'comment_created': datetime.datetime(2020, 7, 9, 13, 38, 40, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}, {'comment_id': 452266117, 'comment_body': 'Yes, agreed. I have also opened an issue for the same(https://github.com/Aniket21mathur/Chapel-protobuf/issues/12).', 'comment_created': datetime.datetime(2020, 7, 9, 14, 37, 28, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452268839, 'comment_body': 'Hmm..I would rather prefer keeping these for now, there are used when we ensure backward compatibility, though we can remove them anytime if they turn out to be useless.', 'comment_created': datetime.datetime(2020, 7, 9, 14, 41, 10, tzinfo=datetime.timezone.utc), 'commenter': 'Aniket21mathur', 'type': 'User'}, {'comment_id': 452273424, 'comment_body': 'Sure, it makes sense to keep them in this PR if you plan to use them in a future PR.', 'comment_created': datetime.datetime(2020, 7, 9, 14, 47, 4, tzinfo=datetime.timezone.utc), 'commenter': 'mppf', 'type': 'User'}]

[{'comment_id': 471754616, 'comment_body': 'Typo: "output", not "ouput" :)', 'comment_created': datetime.datetime(2020, 8, 17, 20, 23, 27, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471754775, 'comment_body': "Might need to do a find/replace on that typo, it's here too", 'comment_created': datetime.datetime(2020, 8, 17, 20, 23, 49, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471756328, 'comment_body': '"alphanumeric", not "aplhanumeric"', 'comment_created': datetime.datetime(2020, 8, 17, 20, 26, 53, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471773887, 'comment_body': "Missing a space after the period.  Also, I'd include the example .proto file that generates the .chpl file - people should be familiar with the ideas from the linked guide, but it will still help to show them side by side", 'comment_created': datetime.datetime(2020, 8, 17, 21, 3, 43, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471774814, 'comment_body': 'I think you want just "a" here - "the a" is definitely wrong, but I think "a" is better than "the" :)', 'comment_created': datetime.datetime(2020, 8, 17, 21, 5, 35, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471775186, 'comment_body': 'In more nit-picky feedback - I think every word should be capitalized in the section title', 'comment_created': datetime.datetime(2020, 8, 17, 21, 6, 22, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471787720, 'comment_body': '"have" -> "has", the compiler generates a singular record :)', 'comment_created': datetime.datetime(2020, 8, 17, 21, 34, 29, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471789352, 'comment_body': "This probably isn't your fault, but this code is a little difficult to read.  I wonder if making them multi-line comments helps?  If not, it might be good to just separate the code and talk about each section of the generated file (e.g., show the whole file without comments, then describe each section, maybe calling out line numbers or something?)", 'comment_created': datetime.datetime(2020, 8, 17, 21, 38, 14, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471790772, 'comment_body': 'Or maybe having an additional line break in between thoughts about a field/method, e.g.
