ed': datetime.datetime(2020, 8, 17, 21, 48, 56, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471794257, 'comment_body': 'This is probably nitpicky and it would be okay to ignore, but I'd say "contains a nested enum _declaration_".', 'comment_created': datetime.datetime(2020, 8, 17, 21, 49, 48, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471796852, 'comment_body': "You're switching between plural and singular again in this section.  I think it's reasonable to indicate that every message declaration will get its own type, but would otherwise lean towards sticking with singular.", 'comment_created': datetime.datetime(2020, 8, 17, 21, 56, 6, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471797151, 'comment_body': 'This one should be purely plural, though (so "is" -> "are")', 'comment_created': datetime.datetime(2020, 8, 17, 21, 56, 46, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471797324, 'comment_body': 'And plural "types"', 'comment_created': datetime.datetime(2020, 8, 17, 21, 57, 9, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471797860, 'comment_body': '"avoiding" -> "avoid" (avoid keeps the same tense as declare, because the "and" joins it with can.  Put another way, you're saying "we can declare ..." and "thus we can avoid ..." but all in one sentence)', 'comment_created': datetime.datetime(2020, 8, 17, 21, 58, 40, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471798202, 'comment_body': 'I think there needs to be an additional line in between this and the start of your note for it to render properly', 'comment_created': datetime.datetime(2020, 8, 17, 21, 59, 22, tzinfo=datetime.timezone.utc), 'commenter': 'lydia-duncan', 'type': 'User'}, {'comment_id': 471798691, 'comment_body': 'Hmm, I